import React from 'react'
import LeaderboardItem from './LeaderboardItem'

const Leaderboard = ({competitionGoals}) => {

  let leaderboardList = (
    competitionGoals.map(goal => {
      <LeaderboardItem goal={goal} />
    })
  );

  return (
    <div>
      <h3>Leaderboard</h3>
      <ul>
        {leaderboardList}
      </ul>
    </div>
  );
};

export default Leaderboard;
